const CreatePage = () => {
  return (
    <main className="mw">
      <h2>새글 등록 </h2>
      <form>
        <label htmlFor="title">제목</label>
        <input
          type="text"
          name="title"
          id="title"
          placeholder="제목을 입력해 주세요"
          //value={'전송되는 값'}
        />

        <p>제목관련 메세지</p>

        <label htmlFor="title">요약내용</label>
        <input
          type="text"
          name="summary"
          id="summary"
          placeholder="요약내용을 입력해 주세요"
          //value={'전송되는 값'}
        />

        <p>요약 메세지</p>

      </form>
    </main>
  );
};
export default CreatePage;
